import { Link } from 'react-router-dom';

export default function Header(){
    return <header>
        
        <ul className='center'>
        <Link to='/'>Home</Link>
        <Link to='events'>Events Page</Link>
        <Link to='NewsLetter'>NewsLetter Page</Link>
        </ul>

    </header>
}
